  {messages: [{"content"=>"Test", "author_id"=>52, "timeStamp"=>1501414491855}, {"content"=>"hello?", "author_id"=>52, "timeStamp"=>1501414496038}, {"content"=>"what's going on?", "author_id"=>52, "timeStamp"=>1501414500598}, {"content"=>"tset", "author_id"=>52, "timeStamp"=>1501414505678}, {"content"=>"test", "author_id"=>52, "timeStamp"=>1501414506213}, {"content"=>"tes", "author_id"=>52, "timeStamp"=>1501414506846}, {"content"=>"test", "author_id"=>52, "timeStamp"=>1501414508334}, {"content"=>"test", "author_id"=>52, "timeStamp"=>1501414509038}, {"content"=>"test", "author_id"=>52, "timeStamp"=>1501414509807}, {"content"=>"Jack!?", "author_id"=>53, "timeStamp"=>1501414667117}, {"content"=>"How was your evening with Thomas?", "author_id"=>52, "timeStamp"=>1501498650704}, {"content"=>"You mean Gretchen Thomas? The brilliant plastics engineer/lesbian?", "author_id"=>53, "timeStamp"=>1501498746694}, {"content"=>"What made you think that I was gay?", "author_id"=>53, "timeStamp"=>1501498763878}, {"content"=>"Your shoes.", "author_id"=>52, "timeStamp"=>1501498782315}, {"content"=>"Well I'm straight.", "author_id"=>53, "timeStamp"=>1501498804152}, {"content"=>"Those shoes are definitely bi-curious.", "author_id"=>53, "timeStamp"=>1501498829524}, {"content"=>"Regardless, I am straight.", "author_id"=>53, "timeStamp"=>1501498851884}, {"content"=>"100% completely straight.", "author_id"=>53, "timeStamp"=>1501498866347}, {"content"=>"I'm sorry if I offended you.", "author_id"=>53, "timeStamp"=>1501498888381}, {"content"=>"Liz?", "author_id"=>52, "timeStamp"=>1501503393289}, {"content"=>"So the standards department is telling me you can only say cat anus three times.", "author_id"=>52, "timeStamp"=>1501503417681}, {"content"=>"But I'm gonna fight for you.", "author_id"=>52, "timeStamp"=>1501503433337}], participants: "52-53"},
  {messages: [{"content"=>"There is no way that I am working with that guy.", "author_id"=>54, "timeStamp"=>1501496337577}, {"content"=>"Do you know that he once got arrested for walking naked through Laguardia?", "author_id"=>54, "timeStamp"=>1501496395133}, {"content"=>"I know...", "author_id"=>53, "timeStamp"=>1501496454333}, {"content"=>"And that he once fell asleep on Ted Danson's roof?", "author_id"=>54, "timeStamp"=>1501496464764}, {"content"=>"Yeah Tracy has many mental health issues.", "author_id"=>53, "timeStamp"=>1501496490236}, {"content"=>"He bit Dakota Fanning on the face!", "author_id"=>54, "timeStamp"=>1501496509013}, {"content"=>"When you hear his version, she was kind of asking for it.", "author_id"=>53, "timeStamp"=>1501496529659}], participants: "53-54"},
  {messages: [{"content"=>"Hey Cerie kind of need to talk to you about something.", "author_id"=>53, "timeStamp"=>1501500609412}, {"content"=>"Do you have a second?", "author_id"=>53, "timeStamp"=>1501500621555}, {"content"=>"Sure.", "author_id"=>60, "timeStamp"=>1501500629107}, {"content"=>"Okay this is gonna sound really weird, but um.. you need to wear a bra.", "author_id"=>53, "timeStamp"=>1501500646220}, {"content"=>"Oh, no, I don't actually. They kind of just stay up on their own. See?", "author_id"=>60, "timeStamp"=>1501500662482}, {"content"=>"Yeah okay. What I'm saying is, you need to ear a bra to work if you want to be taken seriously in this business.", "author_id"=>53, "timeStamp"=>1501500686370}, {"content"=>"No, but I don't actually want to work in television.", "author_id"=>60, "timeStamp"=>1501500704418}, {"content"=>"Career-wise, I'm just gonna marry rich and then design handbags.", "author_id"=>60, "timeStamp"=>1501500722330}, {"content"=>"Here's the thing. The way that you dress is making some peopel around the office uncomfortable.", "author_id"=>53, "timeStamp"=>1501500748161}, {"content"=>"Really? Who?", "author_id"=>60, "timeStamp"=>1501500759464}, {"content"=>"I guess it's mostly me that has the problem with it.", "author_id"=>53, "timeStamp"=>1501500772040}, {"content"=>"Oh, because you have, like one of those body iamge things?", "author_id"=>60, "timeStamp"=>1501500794905}, {"content"=>"No, it's not that.", "author_id"=>53, "timeStamp"=>1501500805256}, {"content"=>"God, because I was gonna say you still have a good body.", "author_id"=>60, "timeStamp"=>1501500828911}, {"content"=>"Well, thank you, but this isn't about me.", "author_id"=>53, "timeStamp"=>1501500841538}, {"content"=>"Like how did you dress before you were married?", "author_id"=>60, "timeStamp"=>1501500852536}, {"content"=>"I'm not married, Cerie.", "author_id"=>53, "timeStamp"=>1501500860231}, {"content"=>"Oh for some reason, I thought you had like three kids.", "author_id"=>60, "timeStamp"=>1501500881263}, {"content"=>"Nope. Not married. No kids", "author_id"=>53, "timeStamp"=>1501500901735}, {"content"=>"Cause sometimes you have like food stains on your shirt and stuff..", "author_id"=>60, "timeStamp"=>1501500914206}, {"content"=>"I just assumed that it was kids.", "author_id"=>60, "timeStamp"=>1501500919022}, {"content"=>"You know what? Forget I mentioned it. You look great.", "author_id"=>53, "timeStamp"=>1501500934247}], participants: "53-60"},
  {messages: [{"content"=>"This is gonna sound crazy, but Tracy can read right?", "author_id"=>53, "timeStamp"=>1501504205135}, {"content"=>"What? Are you serious? The guy's done dozens of movies.", "author_id"=>58, "timeStamp"=>1501504237143}, {"content"=>"Yeah, but it's not like his movies seem like he's reading a script.", "author_id"=>53, "timeStamp"=>1501504259145}, {"content"=>"That's true! And he never reads the cue cards!", "author_id"=>58, "timeStamp"=>1501504297965}, {"content"=>"God I thought all that stuff was just crazy Tracy seeing what he could get away with.", "author_id"=>58, "timeStamp"=>1501504330989}, {"content"=>"I know, but, you know, it's not surprising.", "author_id"=>53, "timeStamp"=>1501504344565}, {"content"=>"Look at the educational system in this country.", "author_id"=>53, "timeStamp"=>1501504355685}, {"content"=>"We spend all this money in Iaq, but meanwhile, our inner-city graduation rates are lower than they are in the Sudan.", "author_id"=>53, "timeStamp"=>1501504398900}, {"content"=>"That doesn't sound right.", "author_id"=>58, "timeStamp"=>1501504405740}, {"content"=>"Maybe it was Sweden.", "author_id"=>53, "timeStamp"=>1501504413532}, {"content"=>"Maybe it was teen pregnancy.", "author_id"=>53, "timeStamp"=>1501504434978}, {"content"=>"I gotta read more.", "author_id"=>53, "timeStamp"=>1501504437697}], participants: "53-58"}
